import React, { useState, useEffect } from 'react';
import API from '../services/api';

interface Task {
  id: number;
  title: string;
  description: string;
  isComplete: boolean;
}

const Tasks: React.FC = () => {
  const [tasks, setTasks] = useState<Task[]>([]);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [editingTaskId, setEditingTaskId] = useState<number | null>(null);
  const [editedTitle, setEditedTitle] = useState('');
  const [editedDescription, setEditedDescription] = useState('');

  const fetchTasks = async () => {
    try {
      const response = await API.get('/tasks');
      setTasks(response.data);
    } catch (err) {
      console.error('Failed to fetch tasks:', err);
    }
  };

  const handleAddTask = async () => {
    try {
      const response = await API.post('/tasks', { title, description });
      setTasks((prev) => [...prev, response.data]);
      setTitle('');
      setDescription('');
    } catch (err) {
      console.error('Failed to add task:', err);
    }
  };

  const handleDeleteTask = async (id: number) => {
    try {
      await API.delete(`/tasks/${id}`);
      setTasks((prev) => prev.filter((task) => task.id !== id));
    } catch (err) {
      console.error('Failed to delete task:', err);
    }
  };

  const handleCompleteTask = async (id: number, isComplete: boolean) => {
    try {
      const updatedTask = await API.put(`/tasks/${id}`, { isComplete: !isComplete });
      setTasks((prev) =>
        prev.map((task) => (task.id === id ? { ...task, isComplete: updatedTask.data.isComplete } : task))
      );
    } catch (err) {
      console.error('Failed to update task:', err);
    }
  };

  const handleEditTask = (task: Task) => {
    setEditingTaskId(task.id);
    setEditedTitle(task.title);
    setEditedDescription(task.description);
  };

  const handleUpdateTask = async (id: number) => {
    try {
      const updatedTask = await API.put(`/tasks/${id}`, {
        title: editedTitle,
        description: editedDescription,
      });
      setTasks((prev) =>
        prev.map((task) => (task.id === id ? { ...task, ...updatedTask.data } : task))
      );
      setEditingTaskId(null);
      setEditedTitle('');
      setEditedDescription('');
    } catch (err) {
      console.error('Failed to update task:', err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/login';
  };

  useEffect(() => {
    fetchTasks();
  }, []);

  return (
    <div>
      <h2>Tasks</h2>
      <button onClick={handleLogout}>Logout</button>
      {tasks.length === 0 ? (
        <p>No tasks</p>
      ) : (
        <ul>
          {tasks.map((task) => (
            <li key={task.id}>
              {editingTaskId === task.id ? (
                <>
                  <input
                    value={editedTitle}
                    onChange={(e) => setEditedTitle(e.target.value)}
                  />
                  <input
                    value={editedDescription}
                    onChange={(e) => setEditedDescription(e.target.value)}
                  />
                  <button onClick={() => handleUpdateTask(task.id)}>Save</button>
                </>
              ) : (
                <>
                  {task.title} - {task.description} ({task.isComplete ? '✅ Complete' : '❌ Incomplete'})
                  <button onClick={() => handleEditTask(task)}>Edit</button>
                  <button onClick={() => handleCompleteTask(task.id, task.isComplete)}>
                    {task.isComplete ? 'Mark Incomplete' : 'Mark Complete'}
                  </button>
                  <button onClick={() => handleDeleteTask(task.id)}>Delete</button>
                </>
              )}
            </li>
          ))}
        </ul>
      )}
      <h3>Add Task</h3>
      <input
        placeholder="Title"
        value={title}
        onChange={(e) => setTitle(e.target.value)}
      />
      <input
        placeholder="Description"
        value={description}
        onChange={(e) => setDescription(e.target.value)}
      />
      <button onClick={handleAddTask}>Add Task</button>
    </div>
  );
};

export default Tasks;
